            BARRAGE: ["\u041d\u0430\u0436\u043c\u0438 \u043d\u0430 \u043c\u043e\u0440\u043e\u0436\u0435\u043d\u043e\u0435, \u0447\u0442\u043e\u0431\u044b \u0443\u0441\u043a\u043e\u0440\u0438\u0442\u044c \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0441\u0442\u0432\u043e", "2333333333333\xa0", "\u041a\u0430\u0436\u0434\u044b\u0439 \u0440\u0430\u0437, \u043a\u043e\u0433\u0434\u0430 \u043d\u0430 \u0444\u0435\u0440\u043c\u0435 \u043f\u043e\u044e\u0442, \u0438\u0434\u0435\u0442 \u0434\u043e\u0436\u0434\u044c!", "\u041f\u043e\u0447\u0435\u043c\u0443 \u043a\u0440\u043e\u0442\u044b \u043f\u043e\u0432\u044b\u0448\u0430\u044e\u0442 \u0443\u0440\u043e\u0436\u0430\u0439?", "\u0416\u043c\u0438 \u0436\u043c\u0438 \u0436\u043c\u0438 \u30fd(\uffe3\u25bd\uffe3)", "(\u30ce0\u25bd0)\u256f..:*\u2606\u041a\u0430\u043a \u0445\u043e\u0440\u043e\u0448\u043e!", "\u041e\u0447\u0435\u043d\u044c \u043c\u043d\u043e\u0433\u043e \u0432\u0438\u0434\u043e\u0432 \u043c\u043e\u0440\u043e\u0436\u0435\u043d\u043e\u0433\u043e! (\u256f\xb0\u0414\xb0)\u256f", "666666\xa0", "\u0422\u043e\u043b\u044c\u043a\u043e \u0447\u0442\u043e \u0441\u0442\u0430\u043b\u043e \u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e, \u0447\u0442\u043e \u0430\u043c\u0431\u0430\u0440 \u043c\u043e\u0436\u043d\u043e \u0443\u043b\u0443\u0447\u0448\u0438\u0442\u044c\u30fd(0\u03c90)", "+1\xa0+1\xa0+1", "\u0416\u043c\u0438! \u041d\u0435 \u0442\u0435\u0440\u044f\u0439 \u0432\u0440\u0435\u043c\u0435\u043d\u0438!\u30fd(#`\u0414\u2032)\u256f", "\u0427\u0442\u043e \u0442\u0430\u043c \u043f\u0440\u0438\u0432\u044f\u0437\u0430\u043d\u043e \u043a \u0448\u0430\u0440\u0438\u043a\u0443?", "\u0412\u043e\u043b\u0448\u0435\u0431\u043d\u043e\u0435 \u0437\u0435\u043b\u044c\u0435 \u0440\u044f\u0434\u043e\u043c \u0441 \u043c\u0430\u0448\u0438\u043d\u043e\u0439 \u043f\u043e\u0432\u044b\u0448\u0430\u0435\u0442 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c.", "\u0423\u0434\u0435\u0440\u0436\u0438\u0432\u0430\u0439, \u0447\u0442\u043e\u0431\u044b \u043f\u043e\u0441\u043c\u043e\u0442\u0440\u0435\u0442\u044c \u043e\u043f\u0438\u0441\u0430\u043d\u0438\u0435.", "\u041d\u0430 \u043f\u043e\u043b\u044f\u0445 \u0444\u0435\u0440\u043c\u044b \u043c\u043e\u0436\u043d\u043e \u043d\u0430\u0439\u0442\u0438 \u043b\u0430\u0440\u0446\u044b \u0441 \u0441\u043e\u043a\u0440\u043e\u0432\u0438\u0449\u0430\u043c\u0438.", "\u0426\u0435\u043b\u044c - -\u0441\u043e\u0431\u0440\u0430\u0442\u044c \u0432\u0441\u0435 \u0440\u0438\u0441\u0443\u043d\u043a\u0438 (\uff5e\uffe3\u25bd\uffe3)\uff5e ", "\u0412\u044b\u0448\u0435 \u0443\u0440\u043e\u0432\u0435\u043d\u044c \u0440\u0430\u0441\u0441\u0430\u0434\u044b, \u0431\u043e\u043b\u044c\u0448\u0435 \u043c\u043e\u0440\u043e\u0436\u0435\u043d\u043e\u0433\u043e \u043c\u043e\u0436\u043d\u043e \u0441\u0434\u0435\u043b\u0430\u0442\u044c."],
